INSERT INTO `themes` (`id`, `temp_name`, `temp_content`, `temp_location`, `temp_location_admin`, `status`, `created_at`, `updated_at`, `temp_default`) VALUES
(1, 'Theme mặc định', '&lt;p&gt;Mẫu thiết kế đặc biệt là sự kết tinh từ nhưng tinh hoa về công nghệ tạo ra mẫu thiết kế đặc trưng này. &lt;/p&gt; 					&lt;ul&gt; 						&lt;li&gt;Thiết kế tập trung vào sản phẩm kết hợp với hiệu ứng linh động giúp thu hút toàn bộ sự chú ý của khách hàng vào mặt hàng bạn đang bán&lt;/li&gt; 						&lt;li&gt;Tốc độ tải trang nhanh chóng cùng với thanh menu thông minh giúp khách hàng không phải chờ đợi lâu khi thăm quan website của bạn&lt;/li&gt; 						&lt;li&gt;Tích hợp trực tiếp website của bạn với các mạng xã hội phổ biến như Facebook, Youtube,Pinterest, G+&lt;/li&gt; 						&lt;li&gt;Tính hợp sẵn chức năng hiển thị các sản phẩm liên quan, giúp khách hàng dễ dàng tìm thấy các sản phẩm&lt;/li&gt; 						&lt;li&gt;Trang liên hệ tích hợp sẵn bản đồ, tùy ý thu phóng giúp khách hàng có thể nhanh chóng tìm thấy cửa hàng của bạn.&lt;/li&gt; 						&lt;li&gt;Tự động cập nhật phiên bản mới nhất, đáp ứng với xu hướng công nghệ. &lt;/li&gt; 					&lt;/ul&gt;', 'default', 'control', 'active', '2016-07-20 12:40:19', '2016-07-20 11:54:00', 0),
(2, 'Main', '', 'main', 'admin', 'active', '2017-04-22 19:02:29', '2017-04-22 18:53:00', 1),
